import React, { Component } from 'react'
import {Button} from "../../components/Button"
class Login extends Component {
    constructor(props){
        super(props);
        this.state = {}
    }

    render(){
        return(
            <div
                style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '90vh'
                }}
            >
                <form>
                    <ul>
                        <li><h2>Input Username</h2></li>
                        <li>
                            <input 
                            style={{
                                width:"200px", 
                                height:"30px",
                                borderRadius:"50px"
                            }}
                            />
                        </li>
                        <li><h2>Input Password</h2></li>
                        <li>
                            <input 
                            style={{
                                width:"200px", 
                                height:"30px",
                                borderRadius:"50px"
                            }}
                            />
                        </li>
                        <li><Button>Login</Button></li>
                    </ul>
                </form>
            </div>
        )
    }
}

export default Login;
